import { connect } from 'react-redux';

const Notification = (props) => {
  const notification = useSelector(state => state.notification);

  const style = {
    border: 'solid',
    padding: 10,
    borderWidth: 1
  };

  return (
    <div style={style}>
      {notification}
    </div>
  );
}

const connectedNotification = connect()(Notification);

export default connectedNotification;
